const socket=io({autoConnect:true});function getProps(){let i=document.getElementById("props").getElementsByTagName("li");let a={};for(let r=0;r<i.length;r++){let t=i[r];let e=t.id;let o=t.querySelector("input");let n=o.value;a[e]=n.trim()}return a}function formatSecondsIntoTime(t){if(t<60){return`${t}s`}else if(t<3600){const e=Math.floor(t/60);const o=t%60;return`${e}min ${o}s`}else if(t<86400){const n=Math.floor(t/3600);const r=Math.floor(t%3600/60);return`${n}h ${r}min`}else{const i=Math.floor(t/86400);const a=Math.floor(t%86400/3600);return`${i}day ${a}h`}}function redirectToMainRoute(){window.location.href="/"}window.onload=()=>{socket.emit("connect")};socket.on("runtime_update",function(t){let e=window.location.href.split("/").pop();var o=t[e];var n=document.querySelector(".runtime-txt");if(n){n.textContent=`Running for : ${formatSecondsIntoTime(o)}`}});function sendData(){data=getProps();let t=window.location.href.split("/").pop();data["bot_name"]=t;socket.emit("saveData",data);alert("Bot Saved Successfuly!!!");redirectToMainRoute()}